<style>	
    html, body, #map {
        Width: 100%;
		height: 300px;
    }
</style>
  
<script>

	var currentLocationIcon = 'data:image/png;base64,';
    var selectedLocationIcon = 'data:image/png;base64,';
	
	navigator.geolocation.getCurrentPosition( function(location) {
	
		var latlng = new L.LatLng(location.coords.latitude, location.coords.longitude);

		var mymap = L.map('map').locate({setView: true, maxZoom: 13}).fitWorld();
	
		L.tileLayer('http://{s}.tile.openstreetmap.org/{z}/{x}/{y}.png', {
			maxZoom: 18,
			tileSize: 512,
			zoomOffset: -1
		}).addTo(mymap);
		
		
		// add custom icon for location
		var currentLocation = L.icon({
			iconUrl: currentLocationIcon,
			iconSize: [25, 25],
			className: 'blinking'
		});
		L.marker(latlng, { icon: currentLocation }).addTo(mymap).bindPopup("<b>Current Location</b><br />" + "<b>lat: </b>" + latlng.lat + "<br /> <b>Long: </b>" + latlng.lng).openPopup();
		$("#store_lat").attr("value", latlng.lat);
		$("#store_lng").attr("value", latlng.lng);
		
		

		// get latitude and longitude on click
		var markerLayerGroup = L.layerGroup().addTo(mymap);
		
		mymap.on('click', function(e) {
			
			markerLayerGroup.clearLayers()
			
			var selectedLocation = L.icon({
				iconUrl: selectedLocationIcon,
				iconSize: [25, 25]
			});
			
			L.marker(e.latlng, { icon: selectedLocation }).addTo(markerLayerGroup).bindPopup("<b>lat: </b>" + e.latlng.lat + "<br /> <b>Long:</b> " + e.latlng.lng).openPopup();
			$("#store_lat").attr("value", e.latlng.lat);
			$("#store_lng").attr("value", e.latlng.lng);
		
			
		});
		
	});
  </script>
  
